(* ::Package:: *)

(* ::Section:: *)
(*S matrix*)


$Assumptions = {r>0, M>0, R>2M , {r,M,R,\[Omega]} \[Element] Reals};


LaunchKernels[]


DistributeDefinitions[Smat, scatamptab, pscatamptab, scatamp, ftab]


SetDirectory[NotebookDirectory[]]; (*don't need this when running on Iceberg..just make sure file is in same directory*)


(* ::Subsection::Closed:: *)
(*Equations*)


f[r_] := 1-2M/r; (*external metric function -g_{00}=1/g_{11}*)
A[r_] := (1/(4*R^3)) ((Sqrt[R^3-2*M*r^2]-3*R*Sqrt[R-2*M])^2)(*interior metric function -g_{00}*)
B[r_] := 1-2*M*r^2/(R^3);(*interior metric function 1/g_{11}*)
\[Rho] = 3*M/(4*\[Pi]*R^3); (*note some references e.g. Chandra + Ferrari use \[Epsilon]=\[Rho]*4\[Pi]*)
(*\[Epsilon]=\[Rho]*4\[Pi];*)
(*p[r_] := \[Rho]*(Sqrt[ 3-8\[Pi]*R^2*\[Rho]]-Sqrt[ 3-8\[Pi]*r^2*\[Rho]])/(Sqrt[ 3-8\[Pi]*r^2*\[Rho]]-3Sqrt[ 3-8\[Pi]*R^2*\[Rho]])//Simplify;*)
Vint[r_] = A[r]((l(l+1))/r^2+B[r]/(2r) (A'[r]/A[r]+B'[r]/B[r])); (*see Cardoso etal 2014 pg3 ^^ *) 
Vext[r_] = f[r]((l(l+1))/r^2+(2*M)/r^3);
eqnext = f[r]^2* D[u[r],{r,2}] +f[r]f'[r]*D[u[r],r] + (\[Omega]^2-Vext[r])u[r]==0; (*equation for Schwarzschild exterior*)
eqninterior = Sqrt[A[r]B[r]]* D[Sqrt[A[r]B[r]]*D[v[r],r],r] + (\[Omega]^2-Vint[r])v[r]==0; (*use v =u to make later code simpler*)
Print["check equations section"]


(* ::Subsection::Closed:: *)
(*Series solution at r = \[Infinity]*)


Clear[gout, gin]


uoutsub = {u[r] ->  Exp[ +I rst[r] \[Omega]] * gout[r], u'[r] -> D[ Exp[ I rst[r] \[Omega]] * gout[r],r], u''[r] -> D[ Exp[ I rst[r] \[Omega]] * gout[r],{r,2}]};
uinsub = {u[r] ->  Exp[ - I rst[r] \[Omega]] * gin[r], u'[r] -> D[ Exp[ -I rst[r] \[Omega]] * gin[r],r], u''[r] -> D[ Exp[ -I rst[r] \[Omega]] * gin[r],{r,2}]};
rstdsubs = {rst'[r] -> 1/f[r], rst''[r]-> D[1/f[r],r]}; 
rstsub = {rst[r]-> r + 2M*Log[(r/(2M))-1 ]};


D[rst[r]/.rstsub,r]-1/f[r]//Simplify;


