(*Series solution at numerical infinity*)


serinf[rmax0_ , \[Omega]0_, M0_, l0_] := Module[ {rmax=rmax0, M=M0, \[Omega]=\[Omega]0, l=l0, vars, eqn, bcinf,\[Tau]pinfOut,\[Tau]pinfIn,\[Tau]out,\[Tau]in,Nprecision,Nmaxp,A,\[Beta],s,\[Tau]p,\[Tau]pi} ,
	vars = Thread[ {M,\[Omega],l} -> {M1,\[Omega]1,l1} ];
	(*bcinf = {u[rmax],u'[rmax]} =={ Ain * \[Phi]in[rmax] + Aout * \[Phi]out[rmax], Ain * \[Phi]in'[rmax] + Aout * \[Phi]out'[rmax] } /.vars;*)
	Nprecision= 300;
	Nmaxp= 300;
	A=l(l+1);
	\[Beta]=1-s^2;
	s=0;
	\[Tau]pinfOut =  RecurrenceTable[{\[Tau]p[n] == N[1/(+2*I*(2*M*\[Omega])*n), Nprecision] ( N[(+2*I*(2*M*\[Omega]) (n - 1) + n*(n - 1) - A), Nprecision] \[Tau]p[n - 1] 
		 + N[(-(n - 2) (2 n - 1) - \[Beta] + A), Nprecision] \[Tau]p[n - 2] 
		 + N[((n - 3) (n - 1) + \[Beta]), Nprecision] \[Tau]p[n - 3]), 
		 \[Tau]p[0] == 1, \[Tau]p[-1] == 0, \[Tau]p[-2] == 0}, \[Tau]p, {n, 0, Nmaxp},  WorkingPrecision -> Nprecision];
	
	\[Tau]pinfIn =  RecurrenceTable[{\[Tau]pi[n] == N[1/(-2*I*(2*M*\[Omega])*n), Nprecision] ( N[(-2*I*(2*M*\[Omega]) (n - 1) + n*(n - 1) - A), Nprecision] \[Tau]pi[n - 1] 
		 + N[(-(n - 2) (2 n - 1) - \[Beta] + A), Nprecision] \[Tau]pi[n - 2] 
		 + N[((n - 3) (n - 1) + \[Beta]), Nprecision] \[Tau]pi[n - 3]), 
		 \[Tau]pi[0] == 1, \[Tau]pi[-1] == 0, \[Tau]pi[-2] == 0}, \[Tau]pi, {n, 0, Nmaxp},  WorkingPrecision -> Nprecision];
	
	(*recall mode time dep is exp[-i\[Omega]t]*)
	\[Tau]out[r_] = (Exp[+I *\[Omega]*(r+2 M Log[-1+r/(2 M)]) ])* Sum[  \[Tau]pinfOut[[i]]/ ((r/(2 M) )^(i-1)) , {i,1,Nmaxp+1}]; 
	\[Tau]in[r_] =  (Exp[-I *\[Omega]*(r+2 M Log[-1+r/(2 M)]) ])* Sum[  \[Tau]pinfIn[[i]]/ ((r/(2 M) )^(i-1)) , {i,1,Nmaxp+1}];
	
	bcinf = { Ain * \[Tau]in[rmax] + Aout * \[Tau]out[rmax], Ain * \[Tau]in'[rmax] + Aout * \[Tau]out'[rmax] } //Flatten 
		
	(*Sum[  \[Tau]pinfOut[[i]]/ ((r/2M)^(i-1)) , {i,1,Nmaxp+1}]*)
]


