If[Re[l1]> -(1/2),
				bcor = {v[\[Epsilon]1],v'[\[Epsilon]1]} == { 1/\[Epsilon]1^(l+1) \[Phi]or[\[Epsilon]1],1/\[Epsilon]1^(l+1) \[Phi]or'[\[Epsilon]1] }/.psolip/.Subscript[pi, 0]->1 /.vars,
				(*we scale the boundary condition to make sure it is not smaller than working precision*)
