(* ::Subsubsection::Closed:: *)
(*Calculating the S matrix and in and out mode coefficients (Subscript[A, in], Subscript[A, out])*)


Smat[ M0_, \[Omega]0_, l0_, R0_, \[Epsilon]0_, rinf0_, wp0_] := Module[ {M=M0, \[Omega]=\[Omega]0, l=l0, R=R0, \[Epsilon]=\[Epsilon]0, rinf=rinf0, wp=wp0, numsol, bcinf,Ainout, S, output,check},
	
	numsol = intorig[rinf, \[Epsilon], R, \[Omega], M, l, wp];
	bcinf = serinf[rinf, \[Omega], M, l];
	
	Ainout = NSolve[ numsol == bcinf , {Ain,Aout}, WorkingPrecision->Precision[numsol]];
	
	check = Abs[Ain]^2/Abs[Aout]^2  ;
	S = (-1)^(l+1)* Aout/Ain   ;
	output = {2*M*\[Omega], l+1/2, Aout, Ain, S} /.Ainout//Flatten
	]


Smatl[ M0_, \[Omega]0_, l0_, R0_, \[Epsilon]0_, rinf0_, wp0_] := Module[ {M=M0, \[Omega]=\[Omega]0, l=l0, R1=R0, \[Epsilon]=\[Epsilon]0, rinf=rinf0, wp=wp0, numsol, bcinf,Ainout, S, output,check},
	
	numsol = intorig[rinf, \[Epsilon], R1, \[Omega], M, l, wp];
	bcinf = serinf[rinf, \[Omega], M, l];
	
	Ainout = NSolve[ numsol == bcinf , {Ain,Aout}, WorkingPrecision->Precision[numsol]];
	
	check = Abs[Ain]^2/Abs[Aout]^2  ;
	S = (-1)^(l+1)* Aout/Ain   ;
	output = {l, S} /.Ainout//Flatten
	]


Print["check num int section"]


