(*Scattering cross section*)


(*Given a table of S matrix values, calculate the scattering cross section*)


(*a0tab = smattab*2*(ltab+1);*)


aRedTable[ a0table0_] := Module[ {a0table = a0table0, a1table, a1table1, nmax, i, output },
		nmax = Length[a0table]; 
		a1table = Table[ a0table[[i+1]] - (i+1)/(2i+3)*a0table[[i+2]] -i/ (2i-1)*a0table[[i]], {i,1,nmax-2}];
		a1table1 = a0table[[1]] - 1/3*a0table[[2]];
		output = Join[ {a1table1}, a1table];
	
		output
]


scatamp[ antable0_ , \[Theta]0_, n0_, \[Omega]0_] :=  Module[ {antable =antable0, \[Theta]=\[Theta]0, n=n0, \[Omega]=\[Omega]0, nmax, fn, f, i},
		nmax = Length[antable];
		
		(*note need to enforce Numerical evaluation of Cos to stop legendrep giving errors near \[Theta]=\[Pi]*)
		fn = 1/(2*I*\[Omega]) * Sum[ antable[[i+1]]*LegendreP[i, N[Cos[\[Theta]]] ], {i, 0, nmax-1} ];
		
		f = 1/(1-Cos[\[Theta]])^n * fn
]


scatamptab[ antable0_ , \[Theta]min0_,\[Theta]max0_, \[Theta]ints0_, n0_, \[Omega]0_] := Module[{antable =antable0, \[Theta]min=\[Theta]min0, 
							\[Theta]max = \[Theta]max0, \[Theta]ints = \[Theta]ints0, n=n0, \[Omega]=\[Omega]0, nmax ,fn,f,i, \[Theta]step},
		
		\[Theta]step = (\[Theta]max-\[Theta]min)/(\[Theta]ints);
		Table[ scatamp[ antable0, \[Theta], n, \[Omega]], {\[Theta], \[Theta]min, \[Theta]max, \[Theta]step}]
]


pscatamptab[ antable0_ , \[Theta]min0_,\[Theta]max0_, \[Theta]ints0_,n0_,\[Omega]0_] := Module[{antable =antable0, \[Theta]min=\[Theta]min0, 
							\[Theta]max = \[Theta]max0, \[Theta]ints = \[Theta]ints0, n=n0, \[Omega]=\[Omega]0,fn,f,i, \[Theta]step},
		
		\[Theta]step = (\[Theta]max-\[Theta]min)/(\[Theta]ints);
		ParallelTable[ scatamp[ antable0, \[Theta], n, \[Omega]], {\[Theta], \[Theta]min, \[Theta]max, \[Theta]step}]
]


